import * as React from 'react'
import './App.css';

interface State {

}

export class App extends React.Component<State> {


    render() {

        return (
            <>
                <Header/>
                <Main movie={'The GodFather'}/>
            </>
        );
    }
}



const Header: React.FunctionComponent = () => (
    <div className={'siteTop'}>
        <h1>LMDB: Lica's Movie Database</h1>
    </div>
);

interface MainMovie {
    movie: string
}

const Main: React.FunctionComponent<MainMovie> = ({movie}) => (
    <div>
        <button>Fav movie</button>
        <p>Lica`s fav movie is: {movie}</p>
    </div>
);

export default App;
